import Stan from '../static/photos_main_page-baw.jpg';
import './Section1.css';

const Section1 = () => {
    return(
        <div id="section1">
            <div class="carre" id="1"></div>
            <div class="carre" id="2"></div>
            <div class="carre" id="3"></div>
            <h1>Stanislas Pielucha</h1>
            <img src={Stan} /> 
        </div>
    )
}

export default Section1;
